Police investigate apparent suicide of teen girl and uncover details of a teenage prostitution racket. They go on the hunt for a motorcycle riding killer.

Sweetly effective giallo/thriller doozy with some really fine moments. With its foreboding name and plot wrapping around a teen prostitution ring one could be forgiven for expecting a sleazy bad taste affair from this one, but creditably it ends up as a restrained and respectful affair with a feel of compassion towards its theme of corrupted innocence.


